    "full_text": "Я вернулся в мой город, знакомый до слез,\nДо прожилок, до детских припухлых желез.\nТы вернулся сюда, — так глотай же скорей\nРыбий жир ленинградских речных фонарей.\nУзнавай же скорее декабрьский денек,\nГде к зловещему дегтю подмешан желток.\nПетербург, я еще не хочу умирать:\nУ тебя телефонов моих номера.\nПетербург, у меня еще есть адреса,\nПо которым найду мертвецов голоса.\nЯ на лестнице черной живу, и в висок\nУдаряет мне вырванный с мясом звонок.\nИ всю ночь напролет жду гостей дорогих,\nШевеля кандалами цепочек дверных.\n\nТворческое объединение [https://vk.com/thywoe|ТВОË ГОРЕ], при поддержке [https://vk.com/ovinovs_org|OVINOV's Org] и [https://vk.com/div_c|Diversant Bivnev], представляет:\n\nDOOM НА НЕВЕ IV\n\uD83D\uDDD3 9 ноября - клуб Ласточка\n\uD83D\uDD54 Начало концерта - 17-00\n\uD83C\uDFAB Билеты - https://vk.cc/czt2vs\n\n[https://vk.com/wdiss|WHO DIES IN SIBERIAN SLUSH]\n(Funeral/Death/Doom metal, Москва)\nWDISS - это о том, что такое конец мира, апокалипсис, потоп, пожар, всемирная погибель, происходящие по очевидным для нас причинам. Это русский взгляд на окружающую нас катастрофу с последнего островка духовности в гибнущем мире. Взгляд, обусловленный нашей культурной и религиозной наследственностью, интеллектом и врожденным ощущением окружающей нас происходящей беды...\nhttps://wdiss.bandcamp.com\n\n[https://vk.com/neuropolis|NEUROPOLIS]\n(Death/Doom metal, Санкт-Петербург)\nБеспощадная поэзия бытия, облачëнная в форму экзистенциальных Doom/Death притч, плачей и яростных рефлексий. Одна из уникальнейших групп в своëм жанре на российской сцене. Ныне NEUROPOLIS - мощнейшее, разящее смыслами и мыслями заявление, это украшенный безумной подачей и атмосферными аранжировками эталонный петербургский Doom/Death metal.\nhttps://neuropolis.bandcamp.com\n\n[https://vk.com/insidetherain|INSIDE THE RAIN]\n(Death/Doom metal, Комсомольск-на-Амуре)\nВпервые на этом краю земли! Группа из Комсомольска-на-Амуре, которая совершит вояж через всю страну, чтобы выступить на DOOM НА НЕВЕ IV. Таинственность, образы потустороннего мира, величие бездны и атмосфера торжества надчеловеческого потока космических сил - все это пронизывает творчество группы Inside the Rain. Дождь словно останавливает привычный бег жизни и заставляет нас прислушаться через его шёпот к истинам мира, которые начинаешь понимать, лишь оказавшись внутри дождя.\n\n[https://vk.com/range_of_truth|RANGE OF TRUTH]\n(Death/Doom metal, Санкт-Петербург)\nНа стыке стилей и эпох, Range Of Truth повествует о стремлении к истинному, бросая саркастические выпады на человечество, с горечью отмечая свою причастность к этому обречëнному на погибель миру. Музыка ROT несёт в себе мелодизм классических клавишных и струнных инструментов прошлых веков, тексты с вышедшими из употребления художественными лексемами, отсылающие к вневременному, наполняя при этом энергетикой Death metal и вливая в слушателей силу оскверненной эстетики.\nhttps://range-of-truth.bandcamp.com\n\n[https://vk.com/shallowrivers|SHALLOW RIVERS]\n(Death/Doom metal, Москва)\nРеки слёз горя и счастья пролить бы, слушая по-есенински лирический Atmospheric Doom Metal в исполнении Shallow Rivers. Мелодии песен о дальних странствиях и испытаниях, о битвах и душевных терзаниях навсегда останутся в сердце, а последний шрам нанесёт проникновенный мужской вокал. Ценителям философских дум об извечном и тяжёлых, нагнетающих печаль аранжировок обязательно стоит посетить выступление этой команды! \nhttps://shallowrivers.bandcamp.com\n\n[https://vk.com/hvergelmirofficial|HVERGELMIR]\n(Sympho/Dark/Folk metal, Санкт-Петербург)\nУникальный взгляд на скандинавский эпос, взгляд мрачный и холодный, как ночное небо над величественными фьордами. Музыка Hvergelmir увлечет симфоническими аранжировками и этническими мотивами навстречу мистерии ваших потаённых страхов и желаний.\nhttps://hvergelmirofficial.bandcamp.c",
